import "./Timer.css";
import { useState } from "react";
import Button from "./Button";
function Timer() {
  let [num, setNum] = useState(0);
  let increaseBtn = () => {
    setNum(num + 1);
  };
  let decreaseBtn = () => {
    setNum(num - 1);
  };
  let resetBtn = () => {
    setNum(0);
  };
  return (
    <>
      <div className="container">
        <h1>{num}</h1>
        {num > 0 && <Button name="decrease" />}
        <Button />
        {num > 0 && <Button />}
      </div>
    </>
  );
}
export default Timer;
